            "text": "Otters are carnivorous, semi-aquatic mammals belonging to the weasel family (**Mustelidae**). There are **13 species** found worldwide, except in Australia and Antarctica.\n\n### Key Facts:\n*   **Habitats:** They live in a variety of environments, from freshwater rivers and lakes to coastal marine waters.\n*   **Physical Traits:** Otters have long, streamlined bodies, webbed feet, and powerful tails that make them excellent swimmers. Their **dense, waterproof fur** is the thickest of any animal, helping them stay warm without a layer of blubber.\n*   **Diet:** They are skilled hunters that primarily eat fish, crustaceans (like crabs and crayfish), and mollusks. Some species, like sea otters, use rocks as tools to crack open shells.\n*   **Social Behavior:** Often described as highly intelligent and playful, otters are known to slide down mud or snow banks for fun.\n*   **Groups:** A group of otters is called a **romp** when on land and a **raft** when floating together in the water. \n\n### Major Types:\n*   **Sea Otters:** The largest of the family, they spend almost their entire lives in the ocean and are famous for floating on their backs.\n*   **River Otters:** Smaller and more agile on land, they are found in freshwater systems across North America, Europe, and Asia.\n*   **Giant Otters:** Found in South America, these can reach up to 6 feet in length and are the most social and vocal of all species.",
