        "groundingSupports": [
          {
            "segment": {
              "endIndex": 93,
              "text": "Otters are carnivorous, semi-aquatic mammals belonging to the weasel family (**Mustelidae**)."
            },
            "groundingChunkIndices": [
              0,
              1,
              2,
              3,
              4,
              5
            ]
          },
          {
            "segment": {
              "startIndex": 94,
              "endIndex": 171,
              "text": "There are **13 species** found worldwide, except in Australia and Antarctica."
            },
            "groundingChunkIndices": [
              0
            ]
          },
          {
            "segment": {
              "startIndex": 188,
              "endIndex": 304,
              "text": "*   **Habitats:** They live in a variety of environments, from freshwater rivers and lakes to coastal marine waters."
            },
            "groundingChunkIndices": [
              6,
              3,
              2,
              7,
              5,
              1,
              8,
              9
            ]
          },
          {
            "segment": {
              "startIndex": 305,
              "endIndex": 434,
              "text": "*   **Physical Traits:** Otters have long, streamlined bodies, webbed feet, and powerful tails that make them excellent swimmers."
            },
            "groundingChunkIndices": [
              3,
              2,
              6,
              0,
              10,
              4,
              1
            ]
          },
          {
            "segment": {
              "startIndex": 435,
              "endIndex": 548,
              "text": "Their **dense, waterproof fur** is the thickest of any animal, helping them stay warm without a layer of blubber."
            },
            "groundingChunkIndices": [
              4
            ]
          },
          {
            "segment": {
              "startIndex": 549,
              "endIndex": 665,
              "text": "*   **Diet:** They are skilled hunters that primarily eat fish, crustaceans (like crabs and crayfish), and mollusks."
            },
            "groundingChunkIndices": [
              2,
              0,
              1
            ]
          },
          {
            "segment": {
              "startIndex": 666,
              "endIndex": 737,
              "text": "Some species, like sea otters, use rocks as tools to crack open shells."
            },
            "groundingChunkIndices": [
              3,
              6,
              0,
              8,
              11,
              12
            ]
          },
          {
            "segment": {
              "startIndex": 738,
              "endIndex": 871,
              "text": "*   **Social Behavior:** Often described as highly intelligent and playful, otters are known to slide down mud or snow banks for fun."
            },
            "groundingChunkIndices": [
              12
            ]
          },
          {
            "segment": {
              "startIndex": 872,
              "endIndex": 991,
              "text": "*   **Groups:** A group of otters is called a **romp** when on land and a **raft** when floating together in the water."
            },
            "groundingChunkIndices": [
              11,
              4
            ]
          },
          {
            "segment": {
              "startIndex": 1011,
              "endIndex": 1151,
              "text": "*   **Sea Otters:** The largest of the family, they spend almost their entire lives in the ocean and are famous for floating on their backs."
            },
            "groundingChunkIndices": [
              8,
              4
            ]
          },
          {
            "segment": {
              "startIndex": 1152,
              "endIndex": 1282,
              "text": "*   **River Otters:** Smaller and more agile on land, they are found in freshwater systems across North America, Europe, and Asia."
            },
            "groundingChunkIndices": [
              2
            ]
