oogle.com/grounding-api-redirect/AUZIYQEOzbdgs9fgeyxdS18iCMijgUnYu-1gRWB4firfGIQgWN_opXIkSScxsHIqCEh8yWSG_UQYe3b4oatFU9GNWt1btLT_HF5EIdhCJcbneETfuEOOXKEZNVZtuwa3osxwjijFUyWQEb1eOyca7Ia-bPmGJivdBTn2","title": "petscare.com"}},{"web": {"uri": "https://vertexaisearch.cloud.google.com/grounding-api-redirect/AUZIYQEmTLD0aAEcyxQ9rDmaTRWl9I_GbpbeTUJOrZj6SsjISv3DULzFnHohZVEO1EQYNOzyjEN0Eb0A1v0LIwMtfv8FLg5ey3qcr-hUHzhOeVyzQ7y4isdkN0_lgQ2ikkZzKuyhjfcFZ55hmI1hoTsmVk8iPJDqQOfmk5hItYAYuSDxXG8=","title": "britannica.com"}},{"web": {"uri": "https://vertexaisearch.cloud.google.com/grounding-api-redirect/AUZIYQGOSorwiqLhuxJg5mBvXjv4ufwy5fEEsM7vdN5ON12Pz_b1gbJfdv4tBJgtawvXdSvrD5zby47ADOVrw_91UCnPEh3idHpjf_x1vYyu38uEOw7MZDNHOwuuHvvLs6txcIRT","title": "britannica.com"}}],"groundingSupports": [{"segment": {"endIndex": 93,"text": "Otters are carnivorous, semi-aquatic mammals belonging to the weasel family (**Mustelidae**)."},"groundingChunkIndices": [0,1,2,3]},{"segment": {"startIndex": 94,"endIndex": 186,"text": "There are **13 species** found worldwide on every continent except Australia and Antarctica."},"groundingChunkIndices": [4]},{"segment": {"startIndex": 202,"endIndex": 356,"text": "*   **Habitat:** Most live in freshwater (rivers, lakes, and marshes), but two species—the sea otter and the marine otter—live primarily in the ocean."},"groundingChunkIndices": [3,4]},{"segment": {"startIndex": 575,"endIndex": 708,"text": "*   **Diet:** They are active hunters that primarily eat fish, but also consume crustaceans, mollusks, frogs, and occasionally birds."},"groundingChunkIndices": [3,2,5]},{"segment": {"startIndex": 709,"endIndex": 881,"text": "*   **Intelligence:** Sea otters are famous for being one of the few animals that **use tools**; they often use rocks to crack open shellfish while floating on their backs."},"groundingChunkIndices": [6,7,8]},{"segment": {"startIndex": 904,"endIndex": 1005,"text": "*   **Rafting:** Sea otters often hold hands while sleeping to prevent drifting apart in the current."},"groundingChunkIndices": [7]},{"segment": {"startIndex": 1006,"endIndex": 1158,"text": "*   **Playfulness:** They are known for "sliding" down muddy or snowy banks into the water, a behavior thought to be both for travel and pure enjoyment."},"groundingChunkIndices": [4,9]},{"segment": {"startIndex": 1159,"endIndex": 1322,"text": "*   **Grooming:** Because they rely on their fur for insulation, otters spend a significant portion of their day meticulously cleaning and fluffing it to trap air."},"groundingChunkIndices": [0,6,4]}],"webSearchQueries": ["brief facts about otters","interesting otter behaviors and characteristics","types of otters and their habitats"]}}],"usageMetadata": {"promptTokenCount": 12,"candidatesTokenCount": 298,"totalTokenCount": 12753,"promptTokensDetails": [{"modality": "TEXT","tokenCount": 12}],"toolUsePromptTokenCount": 12443,"toolUsePromptTokensDetails": [{"modality": "TEXT","tokenCount": 12443}]},"modelVersion": "gemini-3-flash-preview","responseId": "yreOaaaYC7_Wg8UP_dmOoAY"}

